import './css/style.css';

const Header = () => {
  return (
    <div className="header">
    <h1>Hello World</h1>
    <ul>
        <li>CSS</li>
        <li>JS</li>
        <li>REACT</li>
    </ul>
    </div>
  );
}

export default App;
